;; **
;;; ## Distributions
;; **

;; @@
(defn plot-degree-dist [coll]
(let [dat {:degrees (degree t0 tmax :distribution coll)}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :degrees]]
         [:geom_histogram [:aes {:y :..density.. }] {:binwidth 0.125 :colour "black" :fill "white"}]
         [:scale_x_log10]
         [:xlab "Degree"]
         [:ylab "Density"]
         [:theme_bw]
         [:ggtitle (str "Degree distribution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fuscia-leaves/plot-degree-dist</span>","value":"#'fuscia-leaves/plot-degree-dist"}
;; <=

;; @@
(for [n nodes]
  (plot-degree-dist n))
