;; **
;;; ## Evolutions
;; **

;; @@
(defn plot-degree-evolution [coll]
(let [curr (map :mean (degree t0 tmax :evolution coll))
       dat {:ltncs curr
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :ltncs]]
         [:geom_line]
         [:xlab "Day"]
         [:ylab "Average degree"]
         [:theme_bw]
         [:ggtitle (str "Average degree evolution of " (element-name coll))])]
      {:width 5 :height 5})))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-var'>#&#x27;fuscia-leaves/plot-degree-evolution</span>","value":"#'fuscia-leaves/plot-degree-evolution"}
;; <=

;; @@
(for [n nodes]
  (plot-degree-evolution n))
